PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?actor ?actor_label WHERE {
  fb:m.0f1bg fb:film.film_character.portrayed_in_films ?perf .
  ?perf fb:film.performance.actor ?actor .
  OPTIONAL {
    ?actor rdfs:label ?actor_label .
    FILTER ( LANG( ?actor_label ) = "en" )
  }
}
ORDER BY ?actor_label

