PREFIX fb: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?work ?workName ?type WHERE {
  {
    fb:m.08l257 fb:film.actor.film ?perf .
    ?perf fb:film.performance.film ?work .
    ?work fb:type.object.name ?workName .
    FILTER ( langMatches( lang( ?workName ) , 'en' ) ) BIND( "Film" AS ?type )
  } UNION {
    fb:m.08l257 fb:tv.tv_actor.starring_roles ?tperf .
    ?tperf fb:tv.regular_tv_appearance.series ?work .
    ?work fb:type.object.name ?workName .
    FILTER ( langMatches( lang( ?workName ) , 'en' ) ) BIND( "TV series" AS ?type )
  } UNION {
    fb:m.08l257 fb:tv.tv_personality.tv_regular_appearances ?tperf2 .
    ?tperf2 fb:tv.regular_tv_appearance.series ?work .
    ?work fb:type.object.name ?workName .
    FILTER ( langMatches( lang( ?workName ) , 'en' ) ) BIND( "TV series" AS ?type )
  }
}
ORDER BY ?workName

PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?person ?name ?from ?to WHERE {
  ?pos a fb:government.government_position_held ; fb:government.government_position_held.office_position_or_title fb:m.060d2 ; fb:government.government_position_held.office_holder ?person .
  OPTIONAL {
    ?pos fb:government.government_position_held.from ?from .
  }
  OPTIONAL {
    ?pos fb:government.government_position_held.to ?to .
  }
  OPTIONAL {
    ?person fb:type.object.name ?name .
    FILTER ( lang( ?name ) = "en" )
  }
  FILTER ( ( ! bound( ?from ) || xsd:date ( ?from ) <= "1945-09-02" ^^ xsd:date ) && ( ! bound( ?to ) || xsd:date ( ?to ) >= "1939-09-01" ^^ xsd:date ) )
}
ORDER BY ?from

