SELECT ?player ?playerLabel ?draftYear ?draft ?draftLabel ?teamRosterFrom ?teamRoster ?team ?teamLabel ?status WHERE {
  BIND( fb:m.097yk7 AS ?player ) OPTIONAL {
    ?draftPick fb:sports.sports_league_draft_pick.player ?player .
    OPTIONAL {
      ?draftPick rdfs:label ?draftPickLabel .
    }
    OPTIONAL {
      ?draftPick fb:sports.sports_league_draft_pick.draft ?draft .
      OPTIONAL {
        ?draft rdfs:label ?draftLabel .
      }
      OPTIONAL {
        ?draft fb:sports.sports_league_draft.year ?draftYear .
      }
    }
  }
  OPTIONAL {
    ?player fb:sports.pro_athlete.teams ?teamRoster .
    OPTIONAL {
      ?teamRoster fb:sports.sports_team_roster.from ?teamRosterFrom .
    }
    OPTIONAL {
      ?teamRoster fb:sports.sports_team_roster.team ?team .
      OPTIONAL {
        ?team rdfs:label ?teamLabel .
      }
    }
  }
  OPTIONAL {
    ?player rdfs:label ?playerLabel .
  }
  BIND( IF( BOUND( ?draftYear ) , "drafted" , "undrafted" ) AS ?status )
}
