PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX fb: <http://rdf.freebase.com/ns/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
SELECT DISTINCT ?team ?teamLabel ?from ?to WHERE {
  fb:m.05cb70 fb:sports.pro_athlete.teams ?rec .
  ?rec fb:sports.sports_team_roster.team ?team .
  OPTIONAL {
    ?rec fb:sports.sports_team_roster.from ?from .
  }
  OPTIONAL {
    ?rec fb:sports.sports_team_roster.to ?to .
  }
  BIND( IF( bound( ?from ) , IF( datatype( ?from ) = xsd:gYear , xsd:dateTime ( concat ( str( ?from ) , "-01-01T00:00:00" ) ) , xsd:dateTime ( concat ( str( ?from ) , "T00:00:00" ) ) ) , xsd:dateTime ( "0001-01-01T00:00:00" ) ) AS ?start ) BIND( IF( bound( ?to ) , IF( datatype( ?to ) = xsd:gYear , xsd:dateTime ( concat ( str( ?to ) , "-12-31T23:59:59" ) ) , xsd:dateTime ( concat ( str( ?to ) , "T23:59:59" ) ) ) , xsd:dateTime ( "9999-12-31T23:59:59" ) ) AS ?end ) FILTER ( ?start <= xsd:dateTime ( "2011-12-31T23:59:59" ) && ?end >= xsd:dateTime ( "2011-01-01T00:00:00" ) ) OPTIONAL {
    ?team rdfs:label ?teamLabel .
    FILTER ( lang( ?teamLabel ) = "en" )
  }
}

